  return (
    <>
      <p>{`ボタンAを${btn1}回押しました`}</p>

      <button
        onClick={() => {
          setBtn1(btn1 + 1);
          console.log(btn1);
          console.log(setBtn1);
        }}
      >
        ボタンA
      </button>
    </>
  );
};

export default Example;
